private void appendMap(
    StringBuilder buf, int indent, Map<String, Object> map) {
  if (map.isEmpty()) {
    buf.append("{}");
    return;
  }
  buf.append("{");
  newline(buf, indent + 1);
  int n = 0;
  for (Map.Entry<String, Object> entry : map.entrySet()) {
    if (n++ > 0) {
      buf.append(",");
      newline(buf, indent + 1);
    }
    buf.append(entry.getKey());
    buf.append(": ");
    append(buf, indent + 1, entry.getValue());
  }
  newline(buf, indent);
  buf.append("}");
}

